在使用java的时候,java的IDEA或者Eclipse有个很方便的功能,就是能够自动帮你生成ToString方法

有时候为了方便调试,需要把对象的字段打印出来,但是如果对象没有重写ToString的话,则会使用object的默认实现,即打印出类型全限定名称,手动去写这些重写却又很烦,而且C#的集合类型也没有重写ToString方法,这就导致要将一个集合打印出来需要去写一个循环?

在网上找了一下相关的vs插件并没有找到,于是自己想了一个骚操作,通过对object添加扩展方法,然后在扩展方法内里面利用反射,来将该object的字段格式化打印出来,大致思路便是这样.

首先是如何获取一个对象的所有成员信息?

可以通过[Type.GetMembers]()方法来获取,该方法的重载方法接受一个[BindingFlags]()用来筛选想要获取的成员,该方法返回一个[MemberInfo]()数组.

比如要获取一个string对象内部的字段:

    string test = "test";
    Type t = test.GetType();
    //定义成员搜索范围
    BindingFlags bindingFlags = BindingFlags.Instance | BindingFlags.Public | BindingFlags.NonPublic | BindingFlags.Static;
    //是否包含继承的成员
    bool coverParent = true;
    if (!coverParent)
    {
        //BindingFlags.DeclaredOnly指示只包含当前类型所定义的成员,而不包含其基类所定义的成员
        bindingFlags |= BindingFlags.DeclaredOnly;
    }
    //获取所有成员
    foreach (var item in t.GetMembers(bindingFlags))
    {
        //判断该成员是否为字段
        if (item.MemberType == MemberTypes.Field)
        {
            string fieldName = item.Name;
            object fieldValue = t.GetField(item.Name, bindingFlags).GetValue(test);
        }
    }`</pre>

    通过以上代码即可获取到string对象内部的字段,以上代码的输出结果为:
    <pre>`length:4
    start_char:t
    Empty:
    WhiteChars:System.Char[]`</pre>

    这样就完成了最重要的一步了,接下来就是,不希望其他程序集的类型也被打印,只希望打印自己实现的这些类型.

    为什么?

    首先,我是希望能够递归打印的,比如,有这样两个类:
    <pre>`class A
    {
        int i = 0;
        string text = "hi";
        B b = new B();
    }

    class B
    {
        float f = 1.0f;
    }

    A a = new A();`</pre>

    假如现在要打印a对象,那么理想结果应该是怎样的?
    <pre>`{i:0,text:"hi",b:{f:1.0}}`</pre>

    对于string类型的text字段,它应该是直接打印,它不应该再去把string内部的字段打印出来,对于B类型的b字段.它应该继续递归进去,把B内部的成员继续打印出来,那么问题来了,什么时候应该递归进去,什么时候应该结束递归呢?判断的依据似乎是,直到数据为基本数据类型,string类型,StringBuilder类型,枚举类型时,就停止递归.

    最初我的实现便是这样,但是这样是有问题的,比如说现在一个类里面有个Type类型的字段,或者说是DateTime类型的字段,这种情况肯定是不希望进入这些类型的内部去读取它们的信息,最终总结的结果就是,大多数情况下,应该只对自己自定义的类型进行递归打印,而通过程序集引入的类型(比如.net里面的那些类型)应该通过ToString来进行简单的打印.

    所以现在需要解决的问题就是,如果判断一个Type是自定义的,还是引入的?

    首先自己自定义的类型其实也会被编译到一个dll中,至少在Unity里面是这样的,自定义类型会被编译到Assembly-CSharp.dll这个dll中最后由mono来调用,所以只需要随便拿一个自定义的类型获取它所在的dll,那么凡是一个类型所在的dll不在这个dll中,那么就可以认为这个类型不是自己自定义的.
    <pre>`public static class PrintAllFieldExtension
    {
        private static Module currentModule = typeof(PrintAllFieldExtension).Module;

        /// &lt;summary&gt;
        /// 判断某个类型是否为自定义类型
        /// &lt;/summary&gt;
        /// &lt;param name="type"&gt;需要判断的类型&lt;/param&gt;
        /// &lt;returns&gt;&lt;/returns&gt;
        private static bool IsCustomType(Type type)
        {
            return currentModule == type.Module;
        }
    }`</pre>

    所以现在逻辑就变成了,如果一个类型不是自定义的,那么就直接调用他的ToString方法,如果一个类型是自定义的,则获取它的所有字段,并对这些字段进行递归调用该扩展方法,但是<span style="background-color: rgb(249, 150, 59);">如果说两个自定义类型进行了双向引用,</span>那么很明显,递归就会再也出不来了,<span style="background-color: rgb(249, 150, 59);">将会引发堆栈溢出</span>,这个问题先不考虑,后续再来解决.

    还有一个问题,就是对于引入的类型有一个需要特殊处理,那就是.net里面的集合类型,集合类型不能单纯的直接调用ToString,而应该对该集合内的每一个元素都调用该扩展方法,以便能够打印集合的元素值,而不是通过ToString来打印该集合的类型名,那样就没意义了.

    最后附上完整代码:

    gist地址:[https://gist.github.com/zzy213326/44a99372f9225788c34124324030383c]()
    <pre>`/// &lt;summary&gt;
    /// 该扩展方法主要用来将一个对象的所有字段快速打印出来,以便在不重写ToString的情况下,快速打印调试信息
    /// note:该方法可能会引发堆栈溢出异常(两个类双向引用),不应在生产环境使用
    /// &lt;/summary&gt;
    public static class PrintAllFieldExtension
    {
        private static Module currentModule = typeof(PrintAllFieldExtension).Module;

        /// &lt;summary&gt;
        /// 该扩展方法主要用来将一个对象的所有字段快速打印出来,以便在不重写ToString的情况下,快速打印调试信息
        /// &lt;/summary&gt;
        /// &lt;param name="o"&gt;&lt;/param&gt;
        /// &lt;returns&gt;&lt;/returns&gt;
        public static string PrintAllField(this object o, bool coverParent = false)
        {
            string ret = "";
            Type t = o.GetType();
            //如果不是自定义类型,或者如果为枚举类型,直接toString打印
            if (!IsCustomType(t) || o is Enum)
            {
                if (o is string || o is StringBuilder)
                {
                    ret += """ + o.ToString() + """;
                }
                else if (o is ICollection)
                {
                    //如果为集合则循环打印
                    ret += FormatterPrintCollection(o as ICollection, coverParent);
                }
                else
                {
                    ret += o.ToString();
                }
                return ret;
            }
            //定义成员搜索范围
            BindingFlags bindingFlags = BindingFlags.Instance | BindingFlags.Public | BindingFlags.NonPublic | BindingFlags.Static;
            //是否包含继承的成员
            if (!coverParent)
            {
                //BindingFlags.DeclaredOnly指示只包含当前类型所定义的成员,而不包含其基类所定义的成员
                bindingFlags |= BindingFlags.DeclaredOnly;
            }
            ret += "{";
            int count = 0;
            //获取所有成员
            foreach (var item in t.GetMembers(bindingFlags))
            {
                //只打印字段
                if (item.MemberType == MemberTypes.Field)
                {
                    object fieldObj = t.GetField(item.Name, bindingFlags).GetValue(o);
                    if (count != 0)
                    {
                        ret += ",";
                    }
                    ret += item.Name + ":" + JudgePrint(fieldObj, coverParent);
                    count++;
                }
            }
            ret += "}";
            return ret;
        }

        /// &lt;summary&gt;
        /// 判断某个类型是否为自定义类型
        /// &lt;/summary&gt;
        /// &lt;param name="type"&gt;需要判断的类型&lt;/param&gt;
        /// &lt;returns&gt;&lt;/returns&gt;
        private static bool IsCustomType(Type type)
        {
            return currentModule == type.Module;
        }

        //格式化打印数组
        private static string FormatterPrintCollection(ICollection collection, bool coverParent)
        {
            string ret = "[";
            int count = 0;
            foreach (var item in collection)
            {
                if (count != 0)
                {
                    ret += ",";
                }
                //如果这是一个字典,则需要将key和value都打印出来
                if (item.GetType().Name.IndexOf("KeyValuePair`2") != -1)
                {
                    object key = item.GetType().GetField("key", BindingFlags.Instance | BindingFlags.NonPublic).GetValue(item);
                    object value = item.GetType().GetField("value", BindingFlags.Instance | BindingFlags.NonPublic).GetValue(item);
                    ret += JudgePrint(key, coverParent) + ":" + JudgePrint(value, coverParent);
                }
                else
                {
                    ret += JudgePrint(item, coverParent);
                }
                count++;
            }
            ret += "]";
            return ret;
        }

        //判空打印,如果为空则打印null,不为空则PrintAllField
        private static string JudgePrint(object o, bool coverParent)
        {
            return o == null ? "null" : o.PrintAllField(coverParent);
        }
    }

