关于堆栈溢出,发现不仅仅是我的这种实现会出现堆栈溢出,在很多双向引用的实现中都会出现这种情况,典型的一个例子就是json的序列化,如果两个类进行了双向引用,那么序列化其中任意一个对象时都会引发StackOverFlow,不仅仅是C#,在java或者js中都有这种情况,另一方面,如果两个类双向引用,那么使用IDEA为其生成ToString的时候,由于ToString的相互调用,依然会引发StackOverFlow.

所以结论就是,程序中不应该出现一条闭环的引用链路,类之间的引用关系应该始终保持单向,否则可能会引发莫名的StackOverFlow异常
